    Computes the sum of F(S, L, R) over all pairs of integers (L, R) for a given binary string S.

    Parameters:
    S (str): The binary string for which the sum is to be computed.

    Returns:
    int: The sum of F(S, L, R) over all pairs of integers (L, R).
    """

    def calc(array):
        result = 0
        for i in range(1, len(array)):
            if array[i] == array[i - 1]:
                result += 1
        return result

    def answer(p, q):
        result = p * (p - 0) + p * (p - 3) * q // 2
        return result
    sequence = list(S)
    q = calc(sequence)
    return answer(len(S), q)

